import React from "react";
import { UncontrolledCarousel, Row, Col } from "reactstrap";

const items = [
  {
    src: require("./assets/img/paisaje1.jpg"),
    altText: "Slide 1",
    caption: "",
    header: "",
    key: "1",
  },
  {
    src: require("./assets/img/paisaje2.jpg"),
    altText: "Slide 2",
    caption: "",
    header: "",
    key: "2",
  },
  {
    src: require("./assets/img/paisaje3.jpg"),
    altText: "Slide 3",
    caption: "",
    header: "",
    key: "3",
  },
  {
    src: require("./assets/img/paisaje4.jpg"),
    altText: "Slide 4",
    caption: "",
    header: "",
    key: "4",
  },
  {
    src: require("./assets/img/paisaje5.jpg"),
    altText: "Slide 5",
    caption: "",
    header: "",
    key: "5",
  },
];

const Example = () => (
  <Row>
    <Col md="8" className="mx-auto">
      <UncontrolledCarousel items={items} />
    </Col>
  </Row>
);

export default Carrusel;
